import React from "react";

const Jobs =()=>{
    const [data, setData] = React.useState(null);

    React.useEffect(() => {
      fetch("/results")
        .then((res) => res.json())
        .then((data) => setData(data.message));
    }, []);
    console.log(data);
}
export default Jobs
